import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import "./index.css";
import sdata from "./sdata";

function ncard(val) {
  return (
    <Card 
     imgsrc =  {val.imgSrc}
     title  =  {val.title}  
     sname  =  {val.sname}  
     link   =  {val.link}  />  
  )
}

ReactDOM.render(
  <>
  <h1 className="heading_style">List of top 5 songs in 2020 </h1>

  {sdata.map(ncard)}
  </>
  ,document.getElementById('root')
);
